sys_variable_value.value:
(function execute(inputs, outputs) {
//{
//	"id": "4439",
//  "type": "solicitations-publications",
//  "attributes": {
//      "solicitation-id": 4080,
//      "draft": true,
//      "purpose": "draft",
//      "notes": null,
//      "status": "complete",
//      "export-date": "2023-08-23T19:00:43.638Z",
//      "team-id": 67,
//      "file-attributes": {
//           "filename": "SRC0000002 20230823_150105.zip",
//           "checksum": "+Qk7IWxYa9cqDBJ6bDtSng==",
//           "size": 2621388
//       }
//   }
//}
  var json_data = JSON.parse(inputs.string_data);
  var arr = json_data.data;
  var found = false;
  for(i=0; i< arr.length && !found; i++) {
    //Match the first entry and stop the loop
    if(arr[i].attributes["file-attributes"].filename==inputs.Filename &&
       arr[i].attributes["solicitation-id"]==inputs.SolicitationID) {
        found = true;
    	outputs.id=arr[i].id;
      	outputs.type=arr[i].type;
      	outputs.draft=arr[i].attributes["draft"];
      	outputs.purpose=arr[i].attributes["purpose"];
      	outputs.notes=arr[i].attributes["notes"];
     	outputs.status=arr[i].attributes["status"];
      	outputs.export_date=arr[i].attributes["export-date"];
      	outputs.filename=arr[i].attributes["file-attributes"].filename;
      	outputs.checksum=arr[i].attributes["file-attributes"].checksum;
      	outputs.file_size=arr[i].attributes["file-attributes"].size;    
    }    
  }
  //outputs.docidarray = docIds.toString();  

})(inputs, outputs);

